First create your application in the service you want to add. You can find a list of possible services here . Once you created your application, add your service in area-api/oauth.config.js, inside both the web and the android objects. Add the following informations: Name Description client_id The client id received when creating the application in the service client_secret The client secret received when creating the application in the service redirect_uri The uri where users are sent after authorization. This must match exactly the redirect uri that you entered in the service application. Inside the web object, the url must match the following syntax: http://host:port/auth/oauth/serviceName/callbackInside the android object, the url must match the following syntax: area-android://auth/serviceName Example: web: { ... github: { client_id: '********************', client_secret: '****************************************', redirect_uri: 'http://localhost:3000/auth/oauth/github/callback' }
},
android: { ... github: { client_id: '********************', client_secret: '****************************************', redirect_uri: 'area-android://auth/github' }
} Note: Some services do not handle multiple redirect uri. In that case, you can create two application, one for the web client, an the other for the android application. Warning: Some services do not ask for a redirect uri for an mobile application. In that case, you have to search in the service documentation where the service redirect the user after authorization. For those services, you also have to modify the android application itself.

7.body:
Now, you can add the properties of the new service. Create a file in area-api/app/Services/ called as your service, and it in area-api/app/Services/index.js. Your new file must export an object containing the following keys: Name Type Description authType String Type of authentication. Only oauth is accepted for now name String Name of the service. In only lowercase letters and underscores accepted, no space or digits. displayName String Name of the service that will be displayed description String Description of the service baseUrl String Base url of the service iconName String Icon name representing the service. Can be found here foreground String Foreground color of the service, in hexadecimal background String Background color of the service, in hexadecimal irregularAccessToken Boolean True if the service use different arguments or a different way to get the access_token. You must implement the getAccessToken function if this parameter is true codeFlow Boolean True if the service use the authorization code flow. If false, it will use the implicit authorization flow authorizeUrl String Url where the user will be redirected to authorize the application. Cannot contains query parameters accessTokenUrl String Url of the service to get the accessToken scopeSeparator String Url-encoded separator of the scopes scopes Array Scopes that must be authorized Example: module.exports = { authType: 'oauth', name: 'github', displayName: 'Github', description: 'plus tard', baseUrl: 'www.github.com', iconName: 'github-circle', foreground: '#ffffff', background: '#211f1f', irregularAccessToken: true, codeFlow: true, authorizeUrl: "https://github.com/login/oauth/authorize", accessTokenUrl: 'https://github.com/login/oauth/access_token', scopeSeparator: '%20', scopes: [ 'user' ], ... } Then, you have to add the getUser method. Here is the prototype: async getUser(accessToken) This function must return an object with the username and email key. Node: This function must return null if an error as occured Example: const axios = require('axios'); async getUser(accessToken) { const url = "https://api.twitch.tv/helix/users"; try { const response = await axios.get(url, { headers: {'Authorization': 'Bearer ' + accessToken} }); return { username: response.data.data[0].display_name, email: response.data.data[0].email }; } catch (err) { return null; }
} If the service use a irregular way to get the access_token, you have to write the following function (only for authorization code flow): async getAccessToken(code, clientType) This function must return the access_token. Node: This function must return null if an error as occured Node: You can access to the config file by adding require('../../oauth.config.js'); Example: const axios = require('axios');
const ApiInfos = require('../../oauth.config.js'); async getAccessToken(code, clientType) { const data = { client_id: ApiInfos[clientType][this.name].client_id, client_secret: ApiInfos[clientType][this.name].client_secret, code, grant_type: 'authorization_code', redirect_uri: ApiInfos[clientType][this.name].redirect_uri }; try { const response = await axios.post(this.accessTokenUrl, data, { headers: {'Accept': 'application/json'} }); return response.data.access_token; } catch (err) { return null; }
}
